import React from "react";

const NovedadesPage = (props) => {
    return (
        <section className="holder">
            <h2>Novedades</h2>
            <div className="novedades">
                <h2>titulo</h2>
                <h2>subtitulo</h2>
                <h2>cuerpo</h2>
                <hr />
            </div>
            
        </section>
    )
}

export default NovedadesPage
